import React from "react";
import { Container } from "react-bootstrap";
import styled from "styled-components";


const Title = styled.h2`
  font-weight: 300;
`;

const CardContainer = styled.div`
  display: flex;
  flex-wrap: nowrap;
  overflow-x: auto;
  &::-webkit-scrollbar {
    display: none;
  }
`;

const Card = styled.div`
 background-color: gray;
  margin-right: 16px;
  width: 18rem;
  flex-shrink: 0;
`;


const DogCarousel = () => {
  return (
<Container fluid className="py-2 bg-secondary" style={{ overflowX: "hidden" }}>
      <h2 className="font-weight-light">Bootstrap 4 Horizontal Scrolling Cards with Flexbox</h2>
      <div className="d-flex flex-row flex-nowrap overflow-auto" style={{ overflow: "auto" }}>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 1</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 2</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 3</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 4</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 5</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 6</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 7</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 8</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 9</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 10</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 11</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 12</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0 mx-3" style={{ width: "18rem" }}>Card 13</div>
        <div className="card card-body col-lg-3 col-md-4 col-sm-6 flex-shrink-0" style={{ width: "18rem" }}>Card 14</div>
      </div>
    </Container>
  );
};

export default DogCarousel;
